            <span>{title}</span>
            </div>
            <div className={styles.recipeSubtitle}>
            <span>{cookTime}</span>
            </div>
        </div>
    )
}

function RecipeDetails({recipe}) {
  return (
    <></>
  )
}

export default RecipeDetails;
